  `bio` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `gender` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `age` int DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `accompany_code` int DEFAULT NULL,
  `residence_sido_code` int DEFAULT NULL,
  `real_user` tinyint(1) DEFAULT 1,
  PRIMARY KEY (`id`),
  KEY `fk_users_accompany` (`accompany_code`),
